import React from 'react';

//import Img1 from '.../assets/portfolio/1';
//import Img2 from '.../assets/portfolio/2';
//import Img3 from '.../assets/portfolio/3';
//import Img4 from '.../assets/portfolio/4';
//import Img5 from '.../assets/portfolio/5';
//import Img6 from '.../assets/portfolio/6';

import { Link } from 'react-router-dom';

const Portfolio = () => {
  return (
    <section className='section'>
      <div className='container mx-auto h-full relative'>
        <div className='flex flex-col lg:flex-row h-full items-center justify-start gap-x-24 text-center lg:text-left pt-24 lg:pt-36 pb-8'>
          <div>
            <h1 className='h1'>Portfolio</h1>
            <p className='mb-12 max-w-sm'>Here, you'll find a curated selection of my work, showcasing the beauty and serenity of the natural world captured through my lens. From majestic mountains to tranquil lakes, rolling hills, and surprising glimpses of inner-city oases, each photograph tells a unique story of the diverse landscapes I've had the privilege to explore.</p>
						<ul className='mb-12 max-w-sm'>
							<b>Sunrise Over the Mountains:</b> Witness the breathtaking hues of dawn as the sun rises over towering peaks, casting a golden glow across rugged terrain and illuminating the world with a sense of awe and wonder.
						</ul>
						<ul className='max-w-sm'>
							<b>Reflective Lakeside Views:</b> Experience the tranquility of serene lakes nestled amidst lush forests and distant hills, where crystal-clear waters mirror the beauty of the surrounding landscape and create a sense of peaceful contemplation.
						</ul>
						<ul className='mb-12 max-w-sm'>
							<b>Inner City Tranquility:</b> Discover the unexpected beauty of urban landscapes, where vibrant parks, bustling streets, and towering skyscrapers coexist harmoniously with pockets of greenery and quiet sanctuaries, offering a moment of respite from the city's hustle and bustle.
						</ul>
					<Link to={'/contact'} className='btn mb-[30px] mx-auto lg:mx-0'>Let's Connect</Link>
          </div>
          <div>Images</div>
        </div>
      </div>
    </section>
  );
};

export default Portfolio;
